        {           
            string  tmp  = Path.GetTempPath() + "SDIMPORT_"+DateTime.Now.ToString("yyyyMMddhhmm")+"/" ;
            if( !Directory.Exists(tmp) )
            {
                Directory.CreateDirectory(tmp);
            }

            return tmp;
        }

